import { useState } from "react";

const Registrati = () => {
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [username, setUsername] = useState("");
  const [telefono, setTelefono] = useState("");
  const [telefonoLineaFissa, setTelefonoLineaFissa] = useState("");
  const [indirizzo, setIndirizzo] = useState("");
  const [cap, setCap] = useState("");
  const [città, setCittà] = useState("");

  const handleSubmit = async (event) => {
    event.preventDefault();
    console.log("ciao sono qui");
    // Verifica che tutti i campi siano riempiti
    if (!username || !password || !firstName || !lastName || !email || !telefono || !telefonoLineaFissa || !indirizzo || !cap || !città) {
      setError("Tutti i campi sono obbligatori.");
      return;
    }

    setLoading(true); // Impostiamo lo stato di caricamento

    console.log(firstName, lastName, email, password, username, telefono, telefonoLineaFissa, indirizzo, cap, città);
    try {
      const response = await fetch("http://localhost:8000/api/auth/register", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          nome: firstName, // Mappiamo firstName a nome
          cognome: lastName, // Mappiamo lastName a cognome
          email,
          password,
          username,
          telefono,
          telefonoLineaFissa,
          indirizzo,
          cap,
          città,
        }),
      });

      if (!response.ok) {
        throw new Error("Errore nella registrazione, riprova.");
      }

      const data = await response.json();
      console.log("Registrazione avvenuta con successo", data);

      // Reset dei campi di input
      setUsername("");
      setPassword("");
      setFirstName("");
      setLastName("");
      setEmail("");
      setTelefono("");
      setTelefonoLineaFissa("");
      setIndirizzo("");
      setCap("");
      setCittà("");
    } catch (error) {
      setError(error.message); // Gestione degli errori
    } finally {
      setLoading(false); // Disattiviamo lo stato di caricamento
    }
  };

  return (
    <div>
      <h2>Registrati</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="firstName">Nome:</label>
          <input
            type="text"
            id="firstName"
            value={firstName}
            onChange={(e) => setFirstName(e.target.value)} // Gestione input per firstName
          />
        </div>
        <div>
          <label htmlFor="lastName">Cognome:</label>
          <input
            type="text"
            id="lastName"
            value={lastName}
            onChange={(e) => setLastName(e.target.value)} // Gestione input per lastName
          />
        </div>
        <div>
          <label htmlFor="email">Email:</label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)} // Gestione input per email
          />
        </div>
        <div>
          <label htmlFor="username">Username:</label>
          <input
            type="text"
            id="username"
            value={username}
            onChange={(e) => setUsername(e.target.value)} // Gestione input per username
          />
        </div>
        <div>
          <label htmlFor="password">Password:</label>
          <input
            type="password"
            id="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)} // Gestione input per password
          />
        </div>
        <div>
          <label htmlFor="telefono">Telefono:</label>
          <input
            type="text"
            id="telefono"
            value={telefono}
            onChange={(e) => setTelefono(e.target.value)} // Gestione input per telefono
          />
        </div>
        <div>
          <label htmlFor="telefonoLineaFissa">Telefono Linea Fissa:</label>
          <input
            type="text"
            id="telefonoLineaFissa"
            value={telefonoLineaFissa}
            onChange={(e) => setTelefonoLineaFissa(e.target.value)} // Gestione input per telefonoLineaFissa
          />
        </div>
        <div>
          <label htmlFor="indirizzo">Indirizzo:</label>
          <input
            type="text"
            id="indirizzo"
            value={indirizzo}
            onChange={(e) => setIndirizzo(e.target.value)} // Gestione input per indirizzo
          />
        </div>
        <div>
          <label htmlFor="cap">CAP:</label>
          <input
            type="text"
            id="cap"
            value={cap}
            onChange={(e) => setCap(e.target.value)} // Gestione input per cap
          />
        </div>
        <div>
          <label htmlFor="città">Città:</label>
          <input
            type="text"
            id="città"
            value={città}
            onChange={(e) => setCittà(e.target.value)} // Gestione input per città
          />
        </div>

        <button type="submit" disabled={loading}>
          {loading ? "Registrazione in corso..." : "Registrati"}
        </button>
      </form>
      {error && <p style={{ color: "red" }}>{error}</p>} {/* Visualizzazione dell'errore */}
    </div>
  );
};

export default Registrati;
